を打つ。その頃、中年女の夫とその愛人は性愛を交えていたが…。&nbsp;　　古代－－十一世紀。貴船神社の丑満時、嫉妬に燃える中年女が呪いの五寸釘をワラ人形にうちこむ。丑刻語りである。几帳の中で熱い抱擁を交わしている男女、中年の女の夫と愛人の若い女である。突然、女が身もだえしてのげそる。うちこむ五寸釘が呪いをかけてくるのである。現代－－ベッドで悶える裸の男女。古代の男と若い女である。電話のベルが鳴る。受話器を取るが、相手の声は聞こえない。電話のベルと男の動作がくり返される。あるアパートの一室。向いあって坐っている中年の男と女。男は十五年連れ添った妻に離婚を宣言する。しかし、妻は「別れません」と無表情にくりかえす。古代－－丑刻語りの満願の日。暗闇の中より神のお告げがある。「赤い衣を着、顔に朱を塗り、頭に鉄輪を着け、怒りの心をもつならば、勿ら鬼神になろう」。嫉妬の鬼女となった女が狂ったように乱舞する。呪いに耐えかねた男が、陰陽師阿部晴明を訪ね占ってもらう。女の恨みが深く、命も今宵限りだといわれる。現代－－男と若い女が手相を見てもらっている。「怪しげなる妖気がのぼっている、ジェラシーの神の怨みだ」といわれる、その時すうっと中年女が通りすぎる。男と若い女は、電話から逃れるため、高原のホテルに居る。ベッドで二人の濃密なラブシーンがはじまる。突然、電話のベル、まるで生きもののように鳴り続ける。「どうしてここがわかるの、この電話に殺される！」若い女は男にすがりつく。古代－－生霊が、頭に鉄輪を着け、伏した男と女の枕に迫ってくる。現代－－生霊は二人のベッドに迫る。枕もとを呪いをかけて通りすぎる。「きっと奥さんが来てるのよ」と女が言う。隣室に、一人で誰か泊ってるらしい。正体をつかもうとするが失敗。ふと廊下を中年女が通った気配がした。二人は追って出たが、中年女は霧の中へ消えた。古代－－晴明の懸命な祈祷によって、生霊はしだいに力が弱まってきた。一方男も生霊に追いつめられ、息もたえだえにあえいでいるが、生霊はしだいに衰えてきた。「おお無念なり、口惜しき」と叫んで生霊が消えてゆく。現代－－男と若い女が湖畔に立っている。突然、若い女が突きとばされて湖の中へ落ちた。男が助けあげる。岸辺を去ってゆく中年女。ぬれ鼠の二人は、ホテルに戻る。途端に鳴る電話。男が受話器を取り叫ぶ「どこにいるんだ、人殺し！」、やはり返答がない。古代ー吹きすさぶ荒野、頭に鉄輪を着け、顔には朱を塗り、口は裂け、釣り上った目の鬼女が嫉妬の焔を燃して呪いをかけつづける。";s:13:"vod_play_from";s:8:"subom3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:60:"HD高清$https://www.183757.com/20190220/HJs2FRNb/index.m3u8";s:13:"vod_down_from";s:0:"";s:15:"vod_down_server";s:0:"";s:13:"vod_down_note";s:0:"";s:12:"vod_down_url";s:0:"";s:4:"type";a:18:{s:7:"type_id";i:20;s:9:"type_name";s:6:"福利";s:7:"type_en";s:4:"fuli";s:9:"type_sort";i:5;s:8:"type_mid";i:1;s:8:"type_pid";i:0;s:11:"type_status";i:1;s:8:"type_tpl";s:9:"type.html";s:13:"type_tpl_list";s:9:"show.html";s:15:"type_tpl_detail";s:11:"detail.html";s:13:"type_tpl_play";s:9:"play.html";s:13:"type_tpl_down";s:9:"down.html";s:8:"type_key";s:0:"";s:8:"type_des";s:0:"";s:10:"type_title";s:0:"";s:10:"type_union";s:0:"";s:11:"type_extend";a:8:{s:5:"class";s:0:"";s:4:"area";s:0:"";s:4:"lang";s:0:"";s:4:"year";s:0:"";s:4:"star";s:0:"";s:8:"director";s:0:"";s:5:"state";s:0:"";s:7:"version";s:0:"";}s:8:"childids